import React from "react";
import '../Styles/AboutPlatform.css'

function AboutPlatform(){
    return(
        <div className='info'>
            <h1>О Платформе</h1>
            <p className='about-text'><br/>Платформа CoHelper помогает найти партнера по бизнесу.
                найти здесь поставщиков, продавцов и покупателей. А также договориться с другой
                компанией запустить рекламу.
            </p>
        </div>
    )
}

export default AboutPlatform;
